import React from 'react';
import {
  Box,
  Typography,
  Grid,
  Card,
  CardContent
} from '@mui/material';
import Slider from 'react-slick';
import AgricultureIcon from '@mui/icons-material/Agriculture';
import YardIcon from '@mui/icons-material/Yard';
import StoreIcon from '@mui/icons-material/Store';
import HandymanIcon from '@mui/icons-material/Handyman';
import PetsIcon from '@mui/icons-material/Pets';
import LocalDiningIcon from '@mui/icons-material/LocalDining';
import WaterDropIcon from '@mui/icons-material/WaterDrop';
import BugReportIcon from '@mui/icons-material/BugReport';
import ScienceIcon from '@mui/icons-material/Science';
import VaccinesIcon from '@mui/icons-material/Vaccines';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

export default function PantallaInicio() {
  const secciones = [
    {
      imagen: '/imagenes/carrusel1.jpg',
      titulo: 'Ganadería responsable para alimentar al mundo',
      subtitulo: 'Cuidamos cada paso del proceso productivo'
    },
    {
      imagen: '/imagenes/carrusel2.jpg',
      titulo: 'La naturaleza nos da vida, nosotros la protegemos',
      subtitulo: 'Cultivamos con respeto por la tierra'
    },
    {
      imagen: '/imagenes/carrusel3.jpg',
      titulo: 'Sembramos futuro con cada semilla',
      subtitulo: 'Innovación desde el inicio del ciclo productivo'
    },
    {
      imagen: '/imagenes/carrusel4.jpg',
      titulo: 'Frutas frescas, sabor natural directo del campo',
      subtitulo: 'Calidad agrícola para todos'
    }
  ];

  const divisiones = [
    { nombre: 'Acuacultura', color: '#03A9F4', icono: <WaterDropIcon fontSize="medium" /> },
    { nombre: 'Agrícola', color: '#4CAF50', icono: <AgricultureIcon fontSize="medium" /> },
    { nombre: 'Banano', color: '#FFEB3B', icono: <StoreIcon fontSize="medium" /> },
    { nombre: 'Fertilizantes', color: '#8BC34A', icono: <YardIcon fontSize="medium" /> },
    { nombre: 'Larvicultura', color: '#00BCD4', icono: <BugReportIcon fontSize="medium" /> },
    { nombre: 'Mascotas', color: '#009688', icono: <PetsIcon fontSize="medium" /> },
    { nombre: 'Químicos industriales', color: '#9C27B0', icono: <ScienceIcon fontSize="medium" /> },
    { nombre: 'Salud animal', color: '#FF9800', icono: <VaccinesIcon fontSize="medium" /> },
    { nombre: 'Salud pública', color: '#2196F3', icono: <HandymanIcon fontSize="medium" /> },
    { nombre: 'Semillas', color: '#388E3C', icono: <YardIcon fontSize="medium" /> }
  ];

  const settings = {
    dots: true,
    infinite: true,
    autoplay: true,
    autoplaySpeed: 4000,
    arrows: false,
    pauseOnHover: false
  };

  return (
    <Box sx={{ width: '100%', mt: 2 }}>
      {/* 🌾 Carrusel institucional */}
      <Slider {...settings}>
        {secciones.map((item, index) => (
          <Box
            key={index}
            sx={{
              position: 'relative',
              height: '60vh',
              backgroundImage: `url(${item.imagen})`,
              backgroundSize: 'cover',
              backgroundPosition: 'center',
              overflow: 'hidden'
            }}
          >
            <Box
              sx={{
                position: 'absolute',
                inset: 0,
                backgroundColor: 'rgba(0, 0, 0, 0.35)',
                zIndex: 1
              }}
            />
            <Box
              sx={{
                position: 'absolute',
                top: 40,
                left: 60,
                zIndex: 2,
                color: '#fff',
                maxWidth: '60%'
              }}
            >
              <Typography
                variant="h4"
                sx={{ fontWeight: 'bold', textShadow: '2px 2px 4px #000' }}
              >
                {item.titulo}
              </Typography>
              <Typography
                variant="h6"
                sx={{ mt: 1, textShadow: '1px 1px 3px #000' }}
              >
                {item.subtitulo}
              </Typography>
            </Box>
          </Box>
        ))}
      </Slider>

      {/* 🧭 Divisiones estilo Agripac */}
      <Box sx={{ px: 4, py: 6 }}>
        <Typography
          variant="h4"
          sx={{ fontWeight: 'bold', mb: 4 }}
          align="center"
        >
          Nuestras Divisiones
        </Typography>

        <Grid container spacing={2}>
          {divisiones.map((div, index) => (
            <Grid item xs={12} sm={6} key={index}>
              <Card
                sx={{
                  backgroundColor: div.color,
                  color: '#fff',
                  borderRadius: 5,
                  display: 'flex',
                  alignItems: 'center',
                  height: '50px',
                  boxShadow: 2,
                  px: 2,
                  '&:hover': {
                    transform: 'scale(1.01)',
                    transition: '0.3s'
                  }
                }}
              >
                <Box sx={{ pr: 2 }}>{div.icono}</Box>
                <CardContent sx={{ p: 0 }}>
                  <Typography variant="subtitle1" sx={{ fontWeight: 'bold' }}>
                    {div.nombre}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Box>
    </Box>
  );
}
